document.head || (document.head = document.getElementsByTagName('head')[0]);

function getFaviconSrc(host, location){
    var hostlocation_src = {
        'default' : 'data:image/png;base64,',
        'console.aws.amazon.com/cloudformation/home' : 'data:image/png;base64,',
        'console.aws.amazon.com/cloudfront/home' : 'data:image/png;base64,%3D',
        'console.aws.amazon.com/cloudsearch/home' : 'data:image/png;base64,%3D',
        'console.aws.amazon.com/cloudwatch/home' : 'data:image/png;base64,',
        'console.aws.amazon.com/datapipeline/home' : 'data:image/png;base64,%3D%3D',
        'console.aws.amazon.com/dynamodb/home' : 'data:image/png;base64,%3D',
        'console.aws.amazon.com/directconnect/home' : 'data:image/png;base64,',
        'console.aws.amazon.com/ec2/v2/home' : 'data:image/png;base64,%3D%3D',
        'console.aws.amazon.com/ec2/home' : 'data:image/png;base64,%3D%3D',
        'console.aws.amazon.com/elasticache/home' : 'data:image/png;base64,%3D',
        'console.aws.amazon.com/elasticbeanstalk/home' : 'data:image/png;base64,',
        'console.aws.amazon.com/elasticmapreduce/home' : 'data:image/png;base64,%3D%3D',
        'console.aws.amazon.com/elastictranscoder/home' : 'data:image/png;base64,%3D',
        'console.aws.amazon.com/glacier/home' : 'data:image/png;base64,',
        'console.aws.amazon.com/iam/home' : 'data:image/png;base64,%3D%3D',
        'console.aws.amazon.com/opsworks/home' : 'data:image/png;base64,%3D',
        'console.aws.amazon.com/rds/home' : 'data:image/png;base64,%3D%3D',
        'console.aws.amazon.com/redshift/home' : 'data:image/png;base64,%3D',
        'console.aws.amazon.com/route53/home' : 'data:image/png;base64,%3D%3D',
        'console.aws.amazon.com/s3/home' : 'data:image/png;base64,%3D%3D',
        'console.aws.amazon.com/ses/home' : 'data:image/png;base64,%3D',
        'console.aws.amazon.com/sns/home' : 'data:image/png;base64,%3D%3D',
        'console.aws.amazon.com/sqs/home' : 'data:image/png;base64,%3D',
        'console.aws.amazon.com/storagegateway/home' : 'data:image/png;base64,',
        'console.aws.amazon.com/swf/home' : 'data:image/png;base64,%3D%3D',
        'console.aws.amazon.com/vpc/home' : 'data:image/png;base64,%3D%3D',
    };
    return (host + location in hostlocation_src)? hostlocation_src[host + location] :  hostlocation_src['default'];
};

function changeFavicon(src) {
    var linklist = document.getElementsByTagName('link');
    for(var i=linklist.length-1; i>=0; i--){
        if(linklist[i].rel == "icon" || linklist[i].rel == "shortcut icon") {
			document.head.removeChild(linklist[i]);
        }
	}

    var link = document.createElement('link');
    link.rel = 'icon';
    link.href = src;
    document.head.appendChild(link);
}

changeFavicon(getFaviconSrc(location.host, location.pathname));